import navbuttons from '../../../config/NavButtons.config';

import "./NavBar.scss";
import NavButton from '../NavButton';

const NavBar = () => (
  <div id='NavBar'>
    <ul>
      {
        navbuttons.map(button => <NavButton key={button.label} label={button.label} path={button.path} />)
      }
    </ul>
  </div>
);

export default NavBar;
